// HandsPage.js

import React from "react";
import IndustryContainer from "./IndustryContainer";

const HandsPage = () => {
  const industries = [
    // Your industries data here
    {
      title: "Fitness Professionals",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Accountants",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Beauticians",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Psychologists",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Groundskeepers",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Maids",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Veterinarians",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Photographers",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Personal Chefs",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Lawyer",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
    {
      title: "Doctors",
      companies: ["Company 1", "Company 2", "Company 3"],
    },
  ];

  return (
    <div>
      <h1>Hands Page</h1>
      <div className="container">
        {industries.map((industry, index) => (
          <IndustryContainer
            key={index}
            title={industry.title}
            companies={industry.companies}
          />
        ))}
      </div>
    </div>
  );
};

export default HandsPage;
